class InfoClass{
constructor(override){

this.override = override = `
    display: block;
    margin: 0 auto;
    border-color: white;
    `;
}

saveToken = e =>{
    // console.log(e);
localStorage.setItem('login', {
    'token': e,
    login: true,
});
return true;


}
alertErroMsg = e =>{
